import React from 'react';
import RegisterForm from '../components/RegisterForm';

const Register = ({ setIsAuthPage }) => {
  useEffect(() => {
    setIsAuthPage(true);
  }, [setIsAuthPage]);

  return (
    <div>
      <h1>Register</h1>
      <RegisterForm />
    </div>
  );
};

export default Register;
